import React from 'react'
import { ProductData } from './ProductsData';
import { useState } from 'react';
export default function RecomForm() {
  const data=ProductData

  function aa(){
    const a=[];
    for (let i = 0; i < data.length; i++) {
        if(data[i].gender=="mens"){
          a.push(data[i]);
        }
    }
    const b=[];
    for(let i=0;i<a.length;i++){

      for(let j=0;j<a[i].event.length;i++){
        if(a[i].event[j]=="party"){
          b.push(a[i]);
        }
      }
    }

    return a;
  }
  const bb=aa();


  return (
     <div>
      {bb.map((items)=>
       <div>  {items.gender}{items.event[0]}</div>
     
      )}

     </div>
  );
}
